import React, { Component } from 'react'

class color extends Component {
    render() {
        return (
            <div>
                <div class="mainavtar mt-2">
                        <div  class="avatar" style={{backgroundColor:'rgb(255, 0, 0)'}} onclick="bordcolor(style.backgroundColor)"  ></div>
                        <div  class="avatar" style={{backgroundColor:'rgb(255, 255, 0)'}} onclick="bordcolor(style.backgroundColor)" ></div>
                        <div  class="avatar" style={{backgroundColor:'rgb(0, 0, 255)'}} onclick="bordcolor(style.backgroundColor)" ></div>
                </div>

                <div class="insidetext mt-3">
                    <div  class="avatar1" style={{color:'#fff',backgroundColor:'#000'}} onclick="insidecolor(style.color)" >Light</div>
                    <div  class="avatar1" style={{color:'#000',backgroundColor:'#ddd'}} onclick="insidecolor(style.color)">Dark</div>
                </div>

            </div>
        )
    }
}
export default  color
